package com.shuiyu.test.myapplication.Bean;import java.io.Serializable;public class Guide implements Serializable{	private static final long serialVersionUID = 1797240685L;	private String msg;	private Data data;	private long code;	public String getMsg() {		return this.msg;	}	public void setMsg(String msg) {		this.msg = msg;	}	public Data getData() {		return this.data;	}	public void setData(Data data) {		this.data = data;	}	public long getCode() {		return this.code;	}	public void setCode(long code) {		this.code = code;	}	public Guide() {}	public Guide(String msg, Data data, long code){		super();		this.msg = msg;		this.data = data;		this.code = code;	}	public String toString() {		return "Guide [msg = " + msg + ", data = " + data + ", code = " + code + "]";	}}